use gestion_affectation;
CREATE TABLE `materiels2` (
    `id` int(11) NOT NULL,
    `nom` varchar(100) DEFAULT NULL,
    `fonction` varchar(100) DEFAULT NULL,
    `telephone` varchar(20) DEFAULT NULL,
    `email` varchar(100) DEFAULT NULL,
    `departement` varchar(100) DEFAULT NULL,
    `chantier` varchar(100) DEFAULT NULL,
    `date_affectation` date DEFAULT NULL,
    `fabricant` varchar(100) DEFAULT NULL,
    `type` enum(
        'PC Portable',
        'PC Bureau',
        'Imprimante',
        'Routeur',
        'Disque Externe'
    ) DEFAULT NULL,
    `statut` varchar(50) DEFAULT NULL,
    `etat` enum('Neuf', 'Occasion') DEFAULT NULL,
    `num_serie` varchar(100) DEFAULT NULL,
    `num_commande` varchar(100) DEFAULT NULL,
    `utilisateur` varchar(100) DEFAULT NULL
) ENGINE = InnoDB DEFAULT CHARSET = utf8mb4 COLLATE = utf8mb4_general_ci;

select DISTINCT num_serie from materiels where type = "Pc Portable";




